export const Item = ({task,onAddTask}) => {
    return (
        <div className="d-flex my-3 bg-secondary">
            <p className="m-3 pt-2">{task.id}</p>
            <h4 className="me-3 pt-2">{task.name}</h4>
            <button className="btn btn-danger" onClick={() => onAddTask(task)}>Delete</button>
        </div>
    );
}
